import React from "react";
import "./output.css";

function DescText(props) {
  return (
    // ✅ Add return here
    <div>
      <div class="w-[281px] h-[37px] left-0 top-0 absolute text-center text-[#d9d9d9] text-[17px] font-normal font-['Outfit'] leading-snug">
        Software Engineer & Data Analyst
      </div>
      <div class="w-[137px] h-[23px] left-[65px] top-[37px] absolute text-center text-[#d9d9d9] text-lg font-normal font-['Outfit'] leading-snug">
        Guwahati, India
      </div>
    </div>
  );
}

export default DescText;
